const UsersList = props => {
  return (
    <Card>
      <ul className={classes.users}>
        {/* {props.items.map(user => (
          <UserItem
            key={user.id}
            id={user.id}
            onDelete={props.onDeleteUser}
          >
            {user.name} ({user.age} years old)
          </UserItem>
        ))} */}
      </ul>
    </Card>
  );
};
export default UsersList;
